import React from "react";
import Task from "../components/task";

const AllTasks = ({ tasks }) => {
  return (
    <div className="row center-xs">
      {tasks.map((task) => (
        <Task task={task} key={task.id} />
      ))}
    </div>
  );
};

export default AllTasks;
